  "id_str" : "22273495139",
  "text" : "あと、現時点の計算（手法｜機）の能力で、分子動力学的な手法を使うと、コップ一杯どころか、おちょこ一杯ですら厳しいはず・・・。そしてそれが叶ったとしても、現実世界との速度差がどうなるかも分かってないと聞い.. http://togetter.com/li/43442",
