  "id_str" : "22273208954",
  "text" : "あと、どれだけ完全に細部まで計算できても、結局、この世界に分子あるいは原子あるいはそれ以下のレベルで、どこか違う結果になるはずなので、あんまり意味はないですよね。だからモデル化するんですけど。 http://togetter.com/li/43442",
  "id" : 22273208954,
