  "geo" : {
  },
  "id_str" : "20550928052",
  "text" : "まぁ、移動距離とか移動時間にもよるからなんとも言えないけど、しかし高速道路とか使うレベルなら、どっちもどっちな気がする。",
  "id" : 20550928052,
  "created_at" : "Sat Aug 07 13:21:04 +0000 2010",
