  "text" : "#jawp : ただ、個人的な考えとして、例えば水理学の人物記事なんか眺めてると、その人物の出身国（例えばドイツ）の主要言語（例えばドイツ語）、もしくは英語に翻訳された情報源しかない場合があるので、そういう場合には、とりあえずとして、翻訳するだけに留めておくことはありだと思う。",
