  "text" : "mechanicsというと、こう、機構がどうこうとか、固体ががちゃがちゃってする感じ。dynamicsは動きのある現象全般という感じ。なので、水力学は、hydro-dynamicsとは言ってもhydro-mechanicsとは言わない。",
